- uid: System.Web.HttpStaticObjectsCollection.SyncRoot
  id: SyncRoot
  parent: System.Web.HttpStaticObjectsCollection
  langs:
  - csharp
  name: SyncRoot
  nameWithType: HttpStaticObjectsCollection.SyncRoot
  fullName: System.Web.HttpStaticObjectsCollection.SyncRoot
  type: Property
  assemblies:
  - System.Web
  namespace: System.Web
  summary: "Obtém um objeto que pode ser utilizado para sincronizar o acesso à coleção."
  remarks: "Código do programa, geralmente, deve efetuar operações sincronizadas no SyncRoot de uma coleção, não diretamente na coleção de si próprio. Isto assegura um funcionamento correto de coleções que são derivadas de outros objetos. Especificamente, mantém a sincronização adequada com outros threads que podem ser em simultâneo modificar o objeto coleção.       O objeto devolvido nesta implementação é o <xref:System.Web.HttpStaticObjectsCollection>propriamente dito.</xref:System.Web.HttpStaticObjectsCollection>"
  example:
  - "The following example creates an object used to synchronize access to the <xref:System.Web.HttpStaticObjectsCollection>.  \n  \n [!code-vb[Classic HttpStaticObjectsCollection.SyncRoot Example#1](~/add/codesnippet/visualbasic/p-system.web.httpstatico_0_1.vb)]\n [!code-cs[Classic HttpStaticObjectsCollection.SyncRoot Example#1](~/add/codesnippet/csharp/p-system.web.httpstatico_0_1.cs)]"
  syntax:
    content: public object SyncRoot { get; }
    return:
      type: System.Object
      description: "Atual <xref href=&quot;System.Web.HttpStaticObjectsCollection&quot;> </xref>."
  overload: System.Web.HttpStaticObjectsCollection.SyncRoot*
  exceptions: []
  platform:
  - net462
